export const community = require('../assets/icons/community.png')


export default {
    card_icon, claim_icon, dashboard_icon, menu_icon, notification_icon, point_icon, search_icon, clock_icon, page_icon, page_filled_icon,
    plus_icon, bookmark_icon, read_icon, back_arrow_icon,
